import React from "react";
function Ch({onsubmit,childProps})
{
    function submit(e)
    {
        e.preventDefault();
        const a="hello"
        onsubmit(a);
        console.log(childProps);
    }
    
    return(<>
     <button type="button" onClick={submit}>click</button>
    </>
    )
}
export default Ch;
